      "text": "9. Eine Büffel-Ulf mit einer Feder und schönen Gehäuſ; die 8 Tag gibt und Viertel recepiret in billigem Preis, im Berichtshaus zu erſtfragen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "10. Sieben Caum weiſer Margaretha Wibler-Win von 1753, in billigem Preis, im Berichtshaus zu erſtfragen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "11. Eine schöne nuſsbaum Betlades für 2 Personen; mit den Schrauben. Ein sehr elegantes Stück Holz, vornehmlich angestrichen, mit einer kleinen Caffetereia, daſs eine reiche Kauffmann; 2. woſſe nach einer Kette, Eſt und Stein, alle ſo ſchön, im Berichtshaus zu erſtfragen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "12. Der Meister Daniel Hütler ein Doctor: Gatten sind schöne Raunett in Würzen und auch Gold-Silber oder Narcissus Indicus Jacobus in billigem Preis zu haben."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "13. Ein modernes modirendes Kleid in billigem Preis im Berichtshaus zu erſtfragen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "14. Es ſchön Wetter ein gemaltes Herz und die ſtud vom vorigen Jahr, in billigem Preis, im Berichtshaus zu erſtfragen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen:",
      "ntokens": null,
      "text": "15. Wie folgende Bücher zu haben, iſt im Berichtshaus zu erſtfragen: Wünſters eſtomaſt, Randers allgemeine Chronica, Hediſche ſtichſtoriſe; Joseph ſchöner, ſeichſe ſchön, im Berichtshaus zu erſtfragen."
    }
  ]
